import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
import Users from './components/Users';
import Notes from './components/Notes';
import Payments from './components/Payments';
import Upload from './components/Upload';
import Sidebar from './components/Sidebar';
import FireParticles from './components/FireParticles';
import './App.css';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [currentPage, setCurrentPage] = useState('dashboard');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Check if admin is already authenticated
    const apiKey = localStorage.getItem('admin_api_key');
    if (apiKey === 'masterstudent_admin_2024_secure_key') {
      setIsAuthenticated(true);
    }
    setLoading(false);
  }, []);

  const handleLogin = (apiKey) => {
    if (apiKey === 'masterstudent_admin_2024_secure_key') {
      localStorage.setItem('admin_api_key', apiKey);
      setIsAuthenticated(true);
      return true;
    }
    return false;
  };

  const handleLogout = () => {
    localStorage.removeItem('admin_api_key');
    setIsAuthenticated(false);
    setCurrentPage('dashboard');
  };

  if (loading) {
    return (
      <div className="loading-screen">
        <FireParticles />
        <div className="loading-content">
          <div className="fire-logo">ðŸ”¥</div>
          <h2>MasterStudent Admin</h2>
          <div className="loading-spinner"></div>
        </div>
      </div>
    );
  }

  if (!isAuthenticated) {
    return (
      <div className="app">
        <FireParticles />
        <Login onLogin={handleLogin} />
      </div>
    );
  }

  return (
    <div className="app">
      <FireParticles />
      <div className="admin-layout">
        <Sidebar 
          currentPage={currentPage} 
          setCurrentPage={setCurrentPage}
          onLogout={handleLogout}
        />
        <div className="main-content">
          {/* Top Header Bar */}
          <div className="top-header">
            <div className="header-left">
              <h1 className="page-title">
                {currentPage === 'dashboard' && 'ðŸ“Š Dashboard'}
                {currentPage === 'users' && 'ðŸ‘¥ Users Management'}
                {currentPage === 'notes' && 'ðŸ“š Notes Management'}
                {currentPage === 'payments' && 'ðŸ’³ Payments'}
                {currentPage === 'upload' && 'ðŸ“¤ Upload'}
              </h1>
              <p className="page-subtitle">
                {currentPage === 'dashboard' && 'Overview of your platform'}
                {currentPage === 'users' && 'Manage registered users'}
                {currentPage === 'notes' && 'Review and approve student notes'}
                {currentPage === 'payments' && 'Track payment transactions'}
                {currentPage === 'upload' && 'Upload new content'}
              </p>
            </div>
            <div className="header-right">
              <div className="admin-info">
                <div className="admin-avatar">ðŸ”¥</div>
                <div className="admin-details">
                  <span className="admin-name">Admin</span>
                  <span className="admin-role">Super Admin</span>
                </div>
              </div>
            </div>
          </div>

          {/* Main Content Area */}
          <div className="content-wrapper">
            <div className="content-container">
              {currentPage === 'dashboard' && <Dashboard />}
              {currentPage === 'users' && <Users />}
              {currentPage === 'notes' && <Notes />}
              {currentPage === 'payments' && <Payments />}
              {currentPage === 'upload' && <Upload />}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
